import React from 'react'
import styled, {keyframes} from "styled-components";

const Container = styled.div`
    height:800px;
    width:800px;
    position:relative;
    font-size:100px;
    --X:133px;
    --Y:35px;
    background-color:white;
`

const fadeIn = keyframes`
    0% {
        opacity: 0;
        transform: translateX(-50px);
    }
    100% {
        opacity: 1;
        transform: translateX(0px);
    }
`;

const Box = styled.div`
    height:.99em;
    width:.99em;
    position:absolute;
    border:solid 1px black;
    background-color:${props => props.color};
    background: radial-gradient(circle, ${props => props.color} 40%, var(--p-3) 100%);
`

const Box1 = styled(Box)`
    transform:translateY(-1.59em) translateX(-.91em) skew(60deg) rotateX(60deg);
`

const Box2 = styled(Box)`
    transform:translateY(-.92em) translateX(-.24em) skew(30deg) rotateX(30deg);
`

const Box3 = styled(Box)`
    animation:${fadeIn} 2s ease-in-out;
`

const Box4 = styled(Box)`
    transform:translateY(.92em) translateX(-.24em) skew(-30deg) rotateX(-30deg);
`
const Box5 = styled(Box)`
    transform:translateY(1.59em) translateX(-.91em) skew(-60deg) rotateX(-60deg);
`

const Row = styled.div`
    top: 50%;
    left: 50%;
    position: absolute;
`
const Row1 = styled(Row)`
    transform:rotateZ(0deg) translateY(var(--Y)) translateX(var(--X));
`
const Row2 = styled(Row)`

    transform:rotateZ(-60deg) translateY(var(--Y)) translateX(var(--X));
`

const Row3 = styled(Row)`

    transform:rotateZ(-120deg) translateY(var(--Y)) translateX(var(--X));
`

const Row4 = styled(Row)`

    transform:rotateZ(-180deg) translateY(var(--Y)) translateX(var(--X));
`

const Row5 = styled(Row)`

    transform:rotateZ(-240deg) translateY(var(--Y)) translateX(var(--X));
`

const Row6 = styled(Row)`

    transform:rotateZ(-300deg) translateY(var(--Y)) translateX(var(--X));
`

export default function Figure() {
    return (
        <Container>
            <Row1>
                <Box1 color="var(--p-5)"/>
                <Box2 color="var(--p-5)"/>
                <Box3 color="var(--p-5)"/>
                <Box4 color="var(--p-5)"/>
                <Box5 color="var(--p-5)"/>
            </Row1>
            <Row2>
                <Box1 color="var(--p-7)"/>
                <Box2 color="var(--p-7)"/>
                <Box3 color="var(--p-7)"/>
                <Box4 color="var(--p-7)"/>
                <Box5 color="var(--p-7)"/>
            </Row2>
            <Row3>
                <Box1 color="var(--p-5)"/>
                <Box2 color="var(--p-5)"/>
                <Box3 color="var(--p-5)"/>
                <Box4 color="var(--p-5)"/>
                <Box5 color="var(--p-5)"/>
            </Row3>
            <Row4>
                <Box1 color="var(--p-3)"/>
                <Box2 color="var(--p-3)"/>
                <Box3 color="var(--p-3)"/>
                <Box4 color="var(--p-3)"/>
                <Box5 color="var(--p-3)"/>
            </Row4>
            <Row5>
                <Box1 color="var(--p-1)"/>
                <Box2 color="var(--p-1)"/>
                <Box3 color="var(--p-1)"/>
                <Box4 color="var(--p-1)"/>
                <Box5 color="var(--p-1)"/>
            </Row5>
            <Row6>
                <Box1 color="var(--p-3)"/>
                <Box2 color="var(--p-3)"/>
                <Box3 color="var(--p-3)"/>
                <Box4 color="var(--p-3)"/>
                <Box5 color="var(--p-3)"/>
            </Row6>
        </Container>
    )
}
